class Solution:
    def equalSubstring(self, s: str, t: str, maxCost: int) -> int:

        cost = []
        for i in range(len(s)):
            cost.append(abs(ord(s[i]) - ord(t[i])))

        max_conv = 0
        for i in range(len(s)):
            
            budget = maxCost
            j = i
            while (j < len(s) and budget >= cost[j]):
                budget -= cost[j]
                j += 1
                
            if (max_conv < j - i):
                max_conv = j - i
        return max_conv




